import React, {useState} from 'react'

const BigPopUp = ({active, setActive}) => {
    const close = () => {
        setActive(false)
    }
  return (
    <div className={active ? "pop_up active" : 'pop_up'}>
        <div className="pop_up_container">
            <div className="pop_up_body">
                <h1 className="pop_up_text">Mega Win</h1>
                <h1 className="pop_up_text">777</h1>
                <h1 className="pop_up_text">500$</h1>
                <button className="pop_up_close" onCLick = {close}>X</button>
            </div>
        </div>
    </div>
  )
}

export default BigPopUp
